import React, { Component } from "react";
import Layout from "../../components/Layout";
import record from "../../ethereum/record";

class addRecord extends Component {
  render() {
    return (
      <Layout>
        <h3>add files</h3>
      </Layout>
    );
  }
}

export default addRecord;
